import React from "react";
import "../css/App.css";
import image from "./mountain.jpeg";

class Img extends React.Component {
  render() {
    return (
      <div>
        <img src={image} class="ui fluid image">
          <View
            style={{
              position: "absolute",
              top: 0,
              left: 0,
              right: 0,
              bottom: 0,
              justifyContent: "center",
              alignItems: "center"
            }}
          >
            <Text>Centered text</Text>
          </View>
        </img>
      </div>
    );
  }
}

export default Img;
